  "components": {
    "schemas": {
      "KeycloakGroupDetails": {
        "required": [
          "name"
        ],
        "type": "object",
        "properties": {
          "id": {
            "type": "string",
            "description": "Ignored when used for updating the group details"
          },
          "name": {
            "maxLength": 50,
            "minLength": 0,
            "type": "string"
          },
          "pocDetails": {
            "maxLength": 300,
            "minLength": 0,
            "type": "string"
          },
          "pocId": {
            "maxLength": 50,
            "minLength": 0,
            "type": "string"
          },
          "searchPortalConsent": {
            "type": "boolean"
          }
        },
        "description": "Request/Response model for group details."
      },
      "QuickTestUpdateRequest": {
        "type": "object",
        "properties": {
          "result": {
            "maximum": 8,
            "minimum": 6,
            "type": "integer",
            "format": "int32"
          },
          "testBrandId": {
            "maxLength": 15,
            "minLength": 1,
            "type": "string"
          },
          "testBrandName": {
            "maxLength": 200,
            "minLength": 0,
            "type": "string"
          },
          "dccTestManufacturerId": {
            "maxLength": 15,
            "minLength": 1,
            "type": "string"
          },
          "dccTestManufacturerDescription": {
            "maxLength": 128,
            "minLength": 1,
            "type": "string"
          }
        },
